import kotlin.test.*

@OptIn(ExperimentalUnsignedTypes::class)
class CorrectnessTest {
    @Test
    fun testStrings() {
        listOf(
            "",
            "",
            "",
            "",
            "15555757860196863684"
        ).flatMap { listOf(it, "-$it") }.forEach {
            val viaInts = it.toBigIntViaInts()
            val viaUInts = it.toBigIntViaUInts()
            assertEquals(viaInts.sign, viaUInts.sign)
            assertContentEquals(viaInts.magnitude, viaUInts.magnitude)
        }
    }
}
